import React from 'react';
import { Device } from 'Domain/Device';

interface Props {
    devices: Device[]
}

function DeviceList(props: Props): JSX.Element {
let devices = Object.entries(props.devices);
console.log(devices);
    return (
      <ul>
        {devices.map((device) => (
          <li>
            {device.name}: {device.brand}
          </li>
        ))}
      </ul>
    );
}

export default DeviceList;
